  //       "Content-Type": "application/json",
  //       Authorization: `Bearer ${localStorage.getItem("token")}`,
  //     },
  //   }
  // );
  let istoken = false;
  localStorage.getItem("token") ? (istoken = true) : (istoken = false);
  return istoken;
};

export default hasJWT;
